import React, { Component } from 'react';
import axios from 'axios';



class Main extends Component {



    constructor(props) {
        super(props)

        this.state = {
            allCourses: []

        }
    }

    componentDidMount() {
        axios.get('https://saral.navgurukul.org/api/courses')
            .then(posRes => {
                // const allCourses = posRes.data.availableCourses;
                console.log(posRes.data.availableCourses, "poooooooo")
                // this.setState({ allCourses:posRes.data.availableCourses});
                this.setState({ allCourses: posRes.data.availableCourses })
            })
            .catch(errRes => {
                console.log(errRes)

            })
    }


    render() {
        // console.log(this.state.allCourses,"dsahkjfasdkjfkjash")
        console.log(this.state.allCourses, "rtyuiop");
        const { allCourses } = this.state
        return (
            <div className="container">
                <div className="row">
                    {allCourses.map(each =>
                        <div className="col-md-4">
                            <div class="card mb-3" style="max-width: 540px;">
                                <div class="row no-gutters">
                                    <div class="col-md-4">
                                        <img src={each.logo} class="card-img" alt="..."></img>
                                    </div>
                                    <div class="col-md-8">
                                        <div class="card-body">
                    <h5 class="card-title">{ea}</h5>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    )}
                </div>
            </div>
        )
    }
}
export default Main;
